function Head() {
    const list = ['first ingrdient'];
    const map1 = list.map((element) => <li>{element}</li>)
    function handleSubmit() {
        return (
            alert('Sumited')
        )
    }
    function handleClick() {
        return(
            console.log('Clicked')
        )
    }
    return (
    <>
       <main className="head-container">
        <form onSubmit={handleSubmit}>
            <input id='input-field'  placeholder="e.g. oregano" type="text" aria-label="Add ingradient" name='integ'  />

            {/* type = button to avoid changing url submiting when we click the button */}
            <button type= "button" onClick={handleClick}>+ Add ingredient</button>
        </form>
       </main>

       <form>
         <ul>
            {map1}
         </ul>
       </form>
     </>
    )
}



export default Head
